import React from "react";
import '../assets/styles/passwordModal.css';

const PasswordModal = (props) => {
    return(
        <>
            <div className="passwordModal_body p-4">
                    <h5>비밀번호</h5>
                    <input type="text" style={{float:'left',width:100}}></input>
                    <button type="button" className="btn btn-primary">확인</button>
            </div>
        </>
    )
}

export default PasswordModal;
